name: dingtalk

on:
  watch:
    types: [started]

jobs:
  build:
    runs-on: ubuntu-latest

    steps:
      - name: dingtalk robot message
        uses: fifsky/dingtalk-action@master
        with:
          url: ${{ secrets.DINGTALK_WEBHOOK}}
          type: markdown
          content: |
            # 星光不负赶路人，星际伴你前行！
            ![icon](data:image/png;base64,)
            ## [星际工作室官网：galaxy-studio.ga](https://galaxy-studio.ga)
            ### 加入我们：联系钉钉：botqipg 或 发送邮件至 galaxy_studio@outlook.com
            > 星际工作室智能推送
            
